DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `id` varchar(64) NOT NULL COMMENT '主键ID',
  `login_name` varchar(100) NOT NULL COMMENT '用户名称',
  `password` varchar(100) NOT NULL COMMENT '用户密码',
  `status` char(1) DEFAULT '0' COMMENT '账号状态',
  `user_type` char(1) DEFAULT NULL,
  `user_name` varchar(64) DEFAULT NULL COMMENT '用户姓名',
  `user_mobile` varchar(20) DEFAULT NULL COMMENT '用户手机',
  `openid` varchar(64) DEFAULT NULL COMMENT '微信OPENID ',
  `latitude` varchar(64) DEFAULT NULL,
  `longitude` varchar(64) DEFAULT NULL,
  `user_mail` varchar(50) DEFAULT NULL COMMENT '用户邮件',
  `company_name` varchar(200) DEFAULT NULL COMMENT '公司名称',
  `company_type` varchar(200) DEFAULT NULL COMMENT '公司性质',
  `company_phone` varchar(100) DEFAULT NULL COMMENT '公司电话',
  `company_represent` char(1) DEFAULT NULL COMMENT '是否企业代表',
  `service_represent` char(1) DEFAULT NULL COMMENT '是否服务代表',
  `login_ip` varchar(100) DEFAULT NULL COMMENT '最后登陆IP',
  `login_date` datetime DEFAULT NULL COMMENT '最后登陆时间',
  `login_flag` varchar(64) DEFAULT NULL COMMENT '是否可登录(0：正常--1禁用)',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标记',
  `sex` varchar(1) DEFAULT '0',
  `userarea` varchar(100) DEFAULT NULL,
  `is_mailcheck` varchar(1) DEFAULT NULL,
  `head_img_url` varchar(255) DEFAULT NULL COMMENT '微信头像',
  `complete_flag` int(1) DEFAULT '0' COMMENT '用户信息是否已完善过',
  `appid` varchar(255) DEFAULT NULL COMMENT 'appid',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统管理_用户信息表';

